import React from 'react';
import Button from "./Button";
import "../styles/header.css"
const Header = () => {
    return (
        <div className={"header"}>
            <h1>BooKz</h1>
            <nav className={"nav"}>
                <ul >
                    <li>
                        Main
                    </li>
                    <li>
                        Books
                    </li>
                    <li>
                        About
                    </li>
                    <li>
                        My shelf
                    </li>
                    <Button/>
                </ul>

            </nav>
        </div>
    );
};

export default Header;
